import * as React from 'react';
import ImageList from '@mui/material/ImageList';
import ImageListItem from '@mui/material/ImageListItem';
import { Box, Typography } from '@mui/material';
import SwipeDownIcon from '@mui/icons-material/SwipeDown';
import { makeStyles } from '@mui/styles';

export default function Rewiews() {
  const useStyles = makeStyles({
    swipeIcon: {
      animation: '$swipeAnimation 1.5s infinite',
    },
    '@keyframes swipeAnimation': {
      '0%': { transform: 'translateY(0)' },
      '50%': { transform: 'translateY(50px)' },
      '100%': { transform: 'translateY(0)' },
    },
  });

  const itemData = [
    {
      img: 'https://images.unsplash.com/photo-1551963831-b3b1ca40c98e',
      title: 'Breakfast',
    },
    {
      img: 'https://images.unsplash.com/photo-1551782450-a2132b4ba21d',
      title: 'Burger',
    },
    {
      img: 'https://images.unsplash.com/photo-1522770179533-24471fcdba45',
      title: 'Camera',
    },
    {
      img: 'https://images.unsplash.com/photo-1444418776041-9c7e33cc5a9c',
      title: 'Coffee',
    },
    {
      img: 'https://images.unsplash.com/photo-1533827432537-70133748f5c8',
      title: 'Hats',
    },
    {
      img: 'https://images.unsplash.com/photo-1558642452-9d2a7deb7f62',
      title: 'Honey',
    },
    {
      img: 'https://images.unsplash.com/photo-1516802273409-68526ee1bdd6',
      title: 'Basketball',
    },
    {
      img: 'https://images.unsplash.com/photo-1518756131217-31eb79b20e8f',
      title: 'Fern',
    },
    {
      img: 'https://images.unsplash.com/photo-1597645587822-e99fa5d45d25',
      title: 'Mushrooms',
    },
    {
      img: 'https://images.unsplash.com/photo-1567306301408-9b74779a11af',
      title: 'Tomato basil',
    },
    {
      img: 'https://images.unsplash.com/photo-1471357674240-e1a485acb3e1',
      title: 'Sea star',
    },
    {
      img: 'https://images.unsplash.com/photo-1589118949245-7d38baf380d6',
      title: 'Bike',
    },
  ];

  return (
    <>
      <Box
        display={'flex'}
        justifyContent={'space-evenly'}
        alignItems={'center'}
      >
        <Box
          display={'flex'}
          flexDirection={'column'}
          width={'40%'}
          alignContent={'start'}
          paddingTop={'150px'}
        >
          <Typography
            align='left'
            right={'25%'}
            variantMapping={'h1'}
            fontSize={'4em'}
          >
            Отзывы
          </Typography>
          <Typography align='left' variantMapping={'h1'} fontSize={'2em'}>
            Lorem ipsum dolor sit, amet consectetur adipisicing elit.
            Repudiandae qui iste consectetur officiis modi reiciendis numquam
            minus tempore! Id
          </Typography>
        </Box>
        <SwipeDownIcon className={classes.swipeIcon} fontSize="large" />
        <ImageList
          sx={{ width: 600, height: 490, marginTop: 15 }}
          cols={2}
          rowHeight={300}
        >
          {itemData.map((item) => (
            <ImageListItem key={item.img}>
              <img
                src={`${item.img}?w=164&h=164&fit=crop&auto=format`}
                srcSet={`${item.img}?w=164&h=164&fit=crop&auto=format&dpr=2 2x`}
                alt={item.title}
                loading='lazy'
              />
            </ImageListItem>
          ))}
        </ImageList>
      </Box>
    </>
  );
}
